  false,\n\t\"url\": null,\n\t\"notes\": \"The Developer Services Review Program is
  designed to meet the special needs of owners, developers, architects and contractors
  working on moderately- to highly-complex construction or renovation projects. Eligible
  projects include high-rise buildings, mercantile buildings with more than 150,000
  square feet, other occupancies with more than 80,000 square feet, buildings with
  foundations deeper than 12 feet, and residential projects that contain more than
  25 units. This metric tracks the average number of days DOB takes to process individual
  Developer Services Permits, grouped by the week the permit was processed. The target
  average process time is within 89 days. Click here for more information about DOBu2019s
  Developer Services Program.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
